import Item from "./Item";
import React from "react";
import { Col, Row } from "react-bootstrap";
import Productos from "../db.json"

const ItemList = ({data}) => {
    console.log("Estos son los productos", data)

    const productosCatalogo = Productos.productos
  return (
    <div className="columns is-multiline layout mystyle" >
        {productos.map((nombre, imagen, precio) => (
            <Col md="3" mb="2">
                <div>
                    <p> {nombre}</p>
                    <img
                    src={imagen}
                    alt="Placeholder image"
                    />
                    <p> {precio}</p>
                </div>
            </Col>
            )
        )}
    </div>
  )

  return <Row> {productosCatalogo} </Row>
}
export default ItemList;
